import React from "react";
import Breweries from "../breweries/Breweries";
import Search from "../breweries/Search";
import Sidebar from "../layout/Sidebar";

const Home = props => {
  return (
    <div className="row">
      <Sidebar />
      <main className="col-12 col-md-9 " role="main">
        <Search />
        <Breweries />
      </main>
    </div>
  );
};

Home.propTypes = {};

export default Home;
